<!DOCTYPE html>
<html>
  <head>
    <meta charset="utf-8" />
    <link rel="stylesheet" href="globals.css" />
    <link rel="stylesheet" href="styleguide.css" />
    <link rel="stylesheet" href="style.css" />
  </head>
  <body>
    <div class="background">
      <div class="overlap">
        <div class="rectangle"></div>
        <div class="div"></div>
        <div class="frame">
          <div class="chart-axis">
            <div class="main-chart">
              <div class="y-axis-left">
                <div class="text-wrapper">5000</div>
                <div class="text-wrapper-2">4000</div>
                <div class="text-wrapper-2">3000</div>
                <div class="text-wrapper-2">2000</div>
                <div class="text-wrapper-2">1000</div>
                <div class="text-wrapper-2">0</div>
                <div class="text-wrapper-3">Unit: Fahrenheit</div>
              </div>
              <div class="graphi-grid">
                <div class="overlap-group">
                  <div class="x-lines">
                    <img class="line" src="https://c.animaapp.com/g9SZTrRw/img/line.svg" />
                    <img class="img" src="https://c.animaapp.com/g9SZTrRw/img/line-1.svg" />
                    <img class="img" src="https://c.animaapp.com/g9SZTrRw/img/line-2.svg" />
                    <img class="img" src="https://c.animaapp.com/g9SZTrRw/img/line-3.svg" />
                    <img class="img" src="https://c.animaapp.com/g9SZTrRw/img/line-4.svg" />
                    <img class="img" src="https://c.animaapp.com/g9SZTrRw/img/line-5.svg" />
                  </div>
                  <div class="y-lines">
                    <img class="line-2" src="https://c.animaapp.com/g9SZTrRw/img/line-8.svg" />
                    <img class="line-3" src="https://c.animaapp.com/g9SZTrRw/img/line-7.svg" />
                    <img class="line-3" src="https://c.animaapp.com/g9SZTrRw/img/line-8.svg" />
                  </div>
                  <div class="line-area">
                    <div class="overlap-2">
                      <div class="line-group">
                        <div class="overlap-group-2">
                          <img class="single-line-area" src="https://c.animaapp.com/g9SZTrRw/img/singlelinearea1.svg" />
                          <img class="single-line" src="https://c.animaapp.com/g9SZTrRw/img/singleline1.svg" />
                          <div class="line-nodes">
                            <div class="basic-node"><div class="ellipse-line"></div></div>
                            <div class="ellipse-line-wrapper"><div class="ellipse-line"></div></div>
                          </div>
                        </div>
                      </div>
                      <div class="overlap-wrapper">
                        <div class="overlap-3">
                          <img
                            class="single-line-area-2"
                            src="https://c.animaapp.com/g9SZTrRw/img/singlelinearea0.svg"
                          />
                          <img class="single-line-2" src="https://c.animaapp.com/g9SZTrRw/img/singleline0.svg" />
                          <div class="line-nodes-2">
                            <div class="div-wrapper"><div class="ellipse-line-2"></div></div>
                            <div class="basic-node-2"><div class="ellipse-line-2"></div></div>
                          </div>
                        </div>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            </div>
            <div class="x-axis">
              <div class="x-label-box"><div class="text-wrapper-4">Temperature</div></div>
              <div class="x-label-box"><div class="text-wrapper-4">Humidity</div></div>
            </div>
          </div>
          <div class="legends">
            <div class="line-legends">
              <div class="legend">
                <div class="legend-node">
                  <div class="basic-node-wrapper">
                    <div class="basic-node-3"><div class="ellipse-line-2"></div></div>
                  </div>
                </div>
                <div class="text-wrapper-5">2022</div>
              </div>
              <div class="legend">
                <div class="legend-node">
                  <div class="overlap-group-3">
                    <div class="basic-node-3"><div class="ellipse-line"></div></div>
                  </div>
                </div>
                <div class="text-wrapper-5">2023</div>
              </div>
            </div>
          </div>
        </div>
        <div class="rectangle-2"></div>
        <img class="cloud-minus" src="https://c.animaapp.com/g9SZTrRw/img/cloud-minus-1.svg" />
        <img class="cloud-minus-2" src="https://c.animaapp.com/g9SZTrRw/img/cloud-minus-1.svg" />
        <div class="text-wrapper-6">Temperature</div>
        <img
          class="map-maker-georgetown"
          src="https://c.animaapp.com/g9SZTrRw/img/---map-maker--georgetown--washington--district-of-columbia--unit.png"
        />
        <img class="header" src="https://c.animaapp.com/g9SZTrRw/img/header.svg" />
      </div>
    </div>
  </body>
</html>
